    public class IdentityInitializer
    {
        private readonly ApiDbContext _context;
        private readonly KlinikosDbContext _contextKlinikos;
        private readonly RandomNumberGenerator _rng = RandomNumberGenerator.Create();
        private readonly AccessManager _acessmanager;
        private readonly SigningConfigurations _signingConfigurations;
        private readonly TokenConfigurations _tokenConfigurations;

        public IdentityInitializer(ApiDbContext context, SigningConfigurations signingConfigurations,
            TokenConfigurations tokenConfigurations)
        {
            _context = context;
            _signingConfigurations = signingConfigurations;
            _tokenConfigurations = tokenConfigurations;
            _acessmanager = new AccessManager(_signingConfigurations, _tokenConfigurations);
        }

        public IdentityInitializer(KlinikosDbContext contextKlinikos, ApiDbContext context, SigningConfigurations signingConfigurations,
            TokenConfigurations tokenConfigurations)
        {
            _contextKlinikos = contextKlinikos;
            _context = context;
            _acessmanager = new AccessManager(_signingConfigurations, _tokenConfigurations);
        }

        public async void InitializeApi()
        {

            try
            {
                if (_context.Database.EnsureCreated())
                {

                    //Cria roles
                    var listaRoles = new List<Role>() {
                        new Role() {  RoleId = Guid.NewGuid() , NameRole = Roles.ROLE_API_MASTER  },
                        new Role() { RoleId = Guid.NewGuid() , NameRole = Roles.ROLE_API_USUARIOS },
                        new Role() { RoleId = Guid.NewGuid() , NameRole = Roles.ROLE_API_KLINIKOS }
                    };

                    var _userMaster = new Util.UserMaster();


                    #region Cria usuário Master
                    var _user = new User()
                    {
                        UserId = Guid.NewGuid(),
                        Username = _userMaster.Username,
                        Email = _userMaster.Email,
                        Password = _userMaster.Password,
                        Master = true,
                        Ativo = true
                    };

                    await new UserService(_context).Adicionar(_user, _acessmanager, _user.UserId);
                    await new RoleService(_context).AdicionarRange(listaRoles, _user.UserId);

                    //Atribui a role master para o usuário master
                    var _role = listaRoles.Where(x => x.NameRole == Roles.ROLE_API_MASTER).FirstOrDefault();

                    var _userRole = new UserRole() { Role = _role, User = _user };

                    await new UserRoleService(_context).Adicionar(_userRole, _user.UserId);


                    //Cria Sistemas
                    //var listaSistemas = new List<Sistema>() {
                    var sistema = new Sistema() { SistemaId = Guid.NewGuid(), Nome = "KLINIKOS/UPA" };
                    //};

                    await new SistemaService(_context).Adicionar(sistema, _user.UserId);

                    #endregion
                    #region Cria usuário Klinikos
                    var _unidadeUsuarioMaster = new Util.UserMaster();

                    var _password = Convert.ToBase64String(_acessmanager.HashPassword(_unidadeUsuarioMaster.Password, _rng));

                    var _userKlinikos = new User()
                    {
                        UserId = Guid.NewGuid(),
                        Username = "admin",
                        Email = _unidadeUsuarioMaster.Email,
                        Password = _password,
                        ConfirmPassword = _password,
                        Ativo = true

                    };

                    new UserService(_context).AdicionarCarga(_userKlinikos, _userKlinikos.UserId);

                    var _sitema = _context.Sistemas.Where(x => x.Nome.Equals("KLINIKOS/UPA")).FirstOrDefault();

                    var _userSistema = new SistemaUser() { Sistema = _sitema, User = _userKlinikos };

                    new SistemaUserService(_context).AdicionarCarga(_userSistema, _userKlinikos.UserId);


                    var _roleKlinikos = _context.Roles.Where(x => x.NameRole == Roles.ROLE_API_KLINIKOS).FirstOrDefault();

                    var _userRoleKlinikos = new UserRole() { Role = _roleKlinikos, User = _userKlinikos };

                    new UserRoleService(_context).AdicionarCarga(_userRoleKlinikos, _userKlinikos.UserId);
                    #endregion

                }
            }
            catch (Exception ex)
            {

                throw new Exception(
                               ex.Message);

            }
        }



